import Button from 'react-bootstrap/Button'
import Container from 'react-bootstrap/Container'

const User = (props: {currentUser: string, name: string, logs:Array<string>, popup: (type: string, name?: string)=>void}) =>{

  const deleteUser = () =>{
    props.popup('delete', props.name)
  }

  return(
    <Container className={props.currentUser === props.name ? 'userContainer you' : 'userContainer'}>
    <div>
    <h3>{props.name}</h3>
    <Button onClick={deleteUser} className='deleteUserButton' variant='danger'>Delete</Button>
    </div>
    <div>
    {props.logs.map((log) =>{return <p key={log}>{log}</p>})}
    </div>
    </Container>
  )
}

export default User
